import React from "react";
import axios from 'axios';


class FetchAPI extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            data : []
        }
    }

    componentDidMount() {
        axios.get(`http://localhost:5000/Music/believer`)
          .then(res => {
              console.log(res.data);
          })
      }

    render(){
        return <div>Harish</div>
    }
}


export default FetchAPI;
